class Solution {
    fun countPairs(coordinates: List<List<Int>>, k: Int): Int {
        var count = 0
        for (i in 0 until coordinates.size - 1) {
            for (j in i + 1 until coordinates.size) {
                val distance = (coordinates[i][0] xor coordinates[j][0]) + (coordinates[i][1] xor coordinates[j][1])
                if (distance == k) count++
            }
        }
        return count
    }
}
